import React, { useEffect, useState } from "react";
import { BrowserRouter, Routes, Route, Outlet, Navigate } from "react-router-dom";
import Login from "./Auth";
import Dashboard from "./layout/Dashboard/Dashboard";
import NotFoundPage from "./layout/NotFoundPage";

function App() {

  const [isAuthenticated, setIsAuthenticated] = useState(false);

  // const isAuthenticated = /* your authentication logic here */ false;

  const PrivateRoute = ({ element, isAuthenticated }) => {
    if (isAuthenticated) {
      return element;
    } else {
      return <Navigate to="/" />;
    }
  };

  useEffect(()=>{
    const access_token = localStorage.getItem('access_token');
    setIsAuthenticated(Boolean(access_token));
  })

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/" key="root" element={<Outlet />} />
          <Route path="dashboard" element={<PrivateRoute path="dashboard" element={<Dashboard />} isAuthenticated={isAuthenticated} />} />
          <Route path="*" element={<NotFoundPage />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;

















